import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App'
import Experts from './pages/experts';
import reportWebVitals from './reportWebVitals';

import {
  BrowserRouter as Router,
  Route,
  Routes,
} from 'react-router-dom';

// Define your routes
const routes = [
  {
    path: '/',
    component: App,
  },
  {
    path: '/experts', // Corrected the path spelling here
    component: Experts,
  }
];

ReactDOM.render(
  <React.StrictMode>
    <Router>
      {routes.map((route, index) => (
        <Routes
          key={index}
          exact
          path={route.path}
          component={route.component}
        />
      ))}
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
